/* frontend/src/pages/Project.js */
import React from 'react';
import { useParams } from 'react-router-dom';
import TeamHeader from '../components/shared/TeamHeader/TeamHeader';
import './Project.css';

const Project = () => {
  const { projectId } = useParams();

  // Dữ liệu giả định cho team và members
  const teamData = {
    teamName: 'Name team',
    members: [
      { avatar: 'avatar1' },
      { avatar: 'avatar2' },
      { avatar: 'avatar3' },
    ],
  };

  return (
    <div className="project-page">
      <TeamHeader
        teamName={teamData.teamName}
        members={teamData.members}
        activeTab="Introduce"
      />
      <div className="project-content">
        {/* Nội dung của trang Project - tạm thời để trống */}
        <p>Project content will be displayed here.</p>
      </div>
    </div>
  );
};

export default Project;
